    void FPUT::ud_o_update(){
    _ud_o(0, 0) = (*Pi_12)*((1.0/2.0)/(*m_R1) - 1.0/2.0/(*m_L2));
    _ud_o(1, 0) = (*Pi_23)*((1.0/2.0)/(*m_R2) - 1.0/2.0/(*m_L3));
    _ud_o(2, 0) = (*Pi_34)*((1.0/2.0)/(*m_R3) - 1.0/2.0/(*m_L4));
    _ud_o(3, 0) = (*Pi_45)*((1.0/2.0)/(*m_R4) - 1.0/2.0/(*m_L5));
    _ud_o(4, 0) = (*Pi_56)*((1.0/2.0)/(*m_R5) - 1.0/2.0/(*m_L6));
    _ud_o(5, 0) = (*Pi_67)*((1.0/2.0)/(*m_R6) - 1.0/2.0/(*m_L7));

        // Solving implicit system of linear equations
        A_update();
        RHS_update();
        solver.compute(A);

        if(solver.info()!=Success) {
        cout << "Decomposition failed" << endl;
        }

        Eigen::VectorXd delta = solver.solve(RHS_vec);

        if(solver.info()!=Success) {
        cout << "Solving failed" << endl;
        }
        _ud_o(6, 0) = delta(0, 0);
    _ud_o(7, 0) = delta(1, 0);
    _ud_o(8, 0) = delta(2, 0);
    _ud_o(9, 0) = delta(3, 0);
    _ud_o(10, 0) = delta(4, 0);
    _ud_o(11, 0) = delta(5, 0);
}
