void FPUT::A_update(){
        // Update method for matrice A (AKA matrix Q22 in doc 28)
		A.coeffRef(1,1) = 1./(*m_R1) + 1./(*m_L2);
		A.coeffRef(2,2) = 1./(*m_R2) + 1./(*m_L3);
		A.coeffRef(3,3) = 1./(*m_R3) + 1./(*m_L4);
		A.coeffRef(4,4) = 1./(*m_R4) + 1./(*m_L5);
		A.coeffRef(5,5) = 1./(*m_R5) + 1./(*m_L6);
		A.coeffRef(6,6) = 1./(*m_R6) + 1./(*m_L7);
}
void FPUT::A_init(){
        // Init method for matrice A (AKA matrix Q22 in doc 38)
        A.resize(6, 6); // giving matrix the right size 
        A.reserve(6); // allocating memory for sparse mat
    		A.insert(1,1) = 1./(*m_R1) + 1./(*m_L2);
		A.insert(2,2) = 1./(*m_R2) + 1./(*m_L3);
		A.insert(3,3) = 1./(*m_R3) + 1./(*m_L4);
		A.insert(4,4) = 1./(*m_R4) + 1./(*m_L5);
		A.insert(5,5) = 1./(*m_R5) + 1./(*m_L6);
		A.insert(6,6) = 1./(*m_R6) + 1./(*m_L7);
}
